                knob.lineWidth = 1
                context.beginPath()
                context.addPath(knob.cgPath)
                context.addRect(knob.bounds.insetBy(dx: -10, dy: -10))
                context.clip(using: .evenOdd)
                UIColor.black.setStroke()
